$(document).on('shown.bs.modal', '.kt-modal', function () {
    $(this).find('img.lazy-img').each(function () {
        var $img = $(this);
        var realSrc = $img.attr('data-src');
        var currentSrc = $img.attr('src');

        if (realSrc && currentSrc !== realSrc) {
            $img.attr('src', realSrc);
        }
    });
});
